       // \u591A\u6001\u8C03\u7528\n        Shape[] shapes = {circle, rectangle, triangle};\n        for (Shape shape : shapes) {\n            System.out.println("\u5F62\u72B6: " + shape.getClass().getSimpleName());\n            System.out.println("  \u9762\u79EF: " + shape.calculateArea());\n            System.out.println("  \u5468\u957F: " + shape.calculatePerimeter());\n            shape.displayInfo();\n            System.out.println();\n        }\n    }\n}\n\n// \u62BD\u8C61\u7236\u7C7B\nabstract class Shape {\n    protected String name;\n    \n    public Shape(String name) {\n        this.name = name;\n    }\n    \n    // \u62BD\u8C61\u65B9\u6CD5\uFF0C\u5B50\u7C7B\u5FC5\u987B\u5B9E\u73B0\n    public abstract double calculateArea();\n    public abstract double calculatePerimeter();\n    \n    // \u5177\u4F53\u65B9\u6CD5\uFF0C\u5B50\u7C7B\u53EF\u4EE5\u7EE7\u627F\n    public void displayInfo() {\n        System.out.println("  \u540D\u79F0: " + name);\n        System.out.println("  \u9762\u79EF: " + calculateArea());\n        System.out.println("  \u5468\u957F: " + calculatePerimeter());\n    }\n}\n\n// \u5706\u5F62\nclass Circle extends Shape {\n    private double radius;\n    \n    public Circle(double radius) {\n        super("\u5706\u5F62");\n        this.radius = radius;\n    }\n    \n    @Override\n    public double calculateArea() {\n        return Math.PI * radius * radius;\n    }\n    \n    @Override\n    public double calculatePerimeter() {\n        return 2 * Math.PI * radius;\n    }\n}\n\n// \u77E9\u5F62\nclass Rectangle extends Shape {\n    private double width;\n    private double height;\n    \n    public Rectangle(double width, double height) {\n        super("\u77E9\u5F62");\n        this.width = width;\n        this.height = height;\n    }\n    \n    @Override\n    public double calculateArea() {\n        return width * height;\n    }\n    \n    @Override\n    public double calculatePerimeter() {\n        return 2 * (width + height);\n    }\n}\n\n// \u4E09\u89D2\u5F62\nclass Triangle extends Shape {\n    private double side1, side2, side3;\n    \n    public Triangle(double side1, double side2, double side3) {\n        super("\u4E09\u89D2\u5F62");\n        this.side1 = side1;\n        this.side2 = side2;\n        this.side3 = side3;\n    }\n    \n    @Override\n    public double calculateArea() {\n        // \u6D77\u4F26\u516C\u5F0F\n        double s = (side1 + side2 + side3) / 2;\n        return Math.sqrt(s * (s - side1) * (s - side2) * (s - side3));\n    }\n    \n    @Override\n    public double calculatePerimeter() {\n        return side1 + side2 + side3;\n    }\n}\n'})}),"\n",(0,s.jsxs)(e.admonition,{title:"\u7EE7\u627F\u7684\u5C40\u9650\u6027",type:"warning",children:[(0,s.jsxs)(e.ol,{children:["\n",(0,s.jsxs)(e.li,{children:[(0,s.jsx)(e.strong,{children:"\u6253\u7834\u5C01\u88C5"}),"\uFF1A\u5B50\u7C7B\u53EF\u80FD\u4F9D\u8D56\u7236\u7C7B\u7684\u5B9E\u73B0\u7EC6\u8282"]}),"\n",(0,s.jsxs)(e.li,{children:[(0,s.jsx)(e.strong,{children:"\u7D27\u8026\u5408"}),"\uFF1A\u7236\u7C7B\u53D8\u66F4\u53EF\u80FD\u5F71\u54CD\u6240\u6709\u5B50\u7C7B"]}),"\n",(0,s.jsxs)(e.li,{children:[(0,s.jsx)(e.strong,{children:"\u591A\u5C42\u7EE7\u627F\u96BE\u4EE5\u7EF4\u62A4"}),"\uFF1A\u5C42\u6B21\u8FC7\u6DF1\u5BFC\u81F4\u590D\u6742\u5EA6\u589E\u52A0"]}),"\n",(0,s.jsxs)(e.li,{children:[(0,s.jsx)(e.strong,{children:"\u5355\u4E00\u7EE7\u627F\u9650\u5236"}),"\uFF1AJava\u53EA\u5141\u8BB8\u5355\u4E00\u7EE7\u627F"]}),"\n"]}),(0,s.jsx)(e.p,{children:"\u89E3\u51B3\u65B9\u6848\uFF1A"}),(0,s.jsxs)(e.ul,{children:["\n",(0,s.jsx)(e.li,{children:"\u8003\u8651\u4F7F\u7528\u7EC4\u5408\u4EE3\u66FF\u7EE7\u627F"}),"\n",(0,s.jsx)(e.li,{children:"\u63A7\u5236\u7EE7\u627F\u6DF1\u5EA6\uFF08\u4E0D\u8D85\u8FC73\u5C42\uFF09"}),"\n",(0,s.jsx)(e.li,{children:"\u591A\u7528\u63A5\u53E3\uFF0C\u5C11\u7528\u7C7B\u7EE7\u627F"}),"\n",(0,s.jsx)(e.li,{children:"\u8C28\u614E\u8BBE\u8BA1\u7236\u7C7B\uFF0C\u4FDD\u8BC1\u7A33\u5B9A\u6027"}),"\n"]})]}),"\n",(0,s.jsx)(e.h2,{id